import React from "react";
import { useNavigate } from "react-router-dom";
import bath from "../assets/icons/bath.png";
import room from "../assets/icons/room.png";

const Card = ({ location, image }) => {
  const navigate = useNavigate();
  return (
    <div class="card">
      <div class="card-image">
        <img
          onClick={() => navigate("/houseView")}
          style={{
            height: "100%",
            width: "100%",
          }}
          src={image}
          alt=""
        />
      </div>

      <div className="info">
        <div class="room info2">
          <div className="num">2</div>
          <img className="iconimg" src={room} alt="" />
        </div>
        <div className="bathroom info2">
          <div className="num">2</div>
          <img className="iconimg" src={bath} alt="" />
        </div>
      </div>
      <div className="lastrow">
        <div class="heading">{location}</div>
        <button className="cardBtn">Check Out</button>
        <button className="cardBtn">Bookmark</button>
      </div>
    </div>
  );
};

export default Card;
